Aquesta és la '''llista dels articles de qualitat''' ordenada cronològicament, és a dir, els articles estan posats per ordre d'aprovació. En el seu cas, en els '''{{PAGESINCATEGORY:Arxiu d'articles que han perdut la distinció}} articles''' que ja no són de qualitat, hi ha la data en que s'ha retirat o modificat la distinció (vegeu la [[Viquipèdia:Articles de qualitat/Propostes de retirada de la distinció/Taula de seguiment|'''taula de seguiment de les retirades de distincions''']]). 

En aquests moments hi ha '''{{PAGESINCATEGORY:Llista d'articles de qualitat}} articles de qualitat'''. Podeu ordenar la llista per ordre alfabètic, cronològic o per la mida dels articles.

